import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { BarChart3, Trophy, Target, Calendar, BookOpen, Briefcase, Code, Palette, User } from 'lucide-react';
import apiService from '../../services/api';

const TrackerTab = ({ username = 'Jroc_182', tabColor = '#10B981' }) => {
  const [categories, setCategories] = useState([]);
  const [focusStats, setFocusStats] = useState(null);
  const [loading, setLoading] = useState(true);

  const getIconComponent = (iconName) => {
    const iconMap = {
      'BookOpen': BookOpen,
      'Briefcase': Briefcase,
      'Palette': Palette,
      'Code': Code,
      'User': User
    };
    return iconMap[iconName] || User;
  };

  useEffect(() => {
    const loadTrackerData = async () => {
      try {
        setLoading(true);

        // Load categories with XP
        const categoryData = await apiService.getFocusCategories(username);
        setCategories(categoryData);

        // Load focus statistics
        const stats = await apiService.getFocusAnalytics(username, 'week');
        setFocusStats(stats);

      } catch (error) {
        console.error('Error loading tracker data:', error);
        // Fallback to localStorage
        const saved = localStorage.getItem('focusCategories');
        if (saved) {
          setCategories(JSON.parse(saved));
        }
      } finally {
        setLoading(false);
      }
    };

    loadTrackerData();
  }, [username]);

  if (loading) {
    return (
      <div className="p-6 text-center">
        <div className="text-white font-mono">Loading tracker data...</div>
      </div>
    );
  }

  return (
    <div className="p-6 space-y-6">
      {/* Header */}
      <motion.div
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        className="mb-8"
      >
        <h1 className="font-mono text-3xl font-bold text-white mb-2 flex items-center gap-3">
          <div 
            className="w-6 h-6 border border-gray-600" 
            style={{ backgroundColor: tabColor }}
          />
          FOCUS TRACKER
        </h1>
        <p className="text-gray-400 font-mono text-sm">
          Track your focus sessions and XP across different categories.
        </p>
      </motion.div>

      {/* Focus Stats */}
      {focusStats && (
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="bg-gray-800 border-2 border-green-500 p-6"
        >
          <h2 className="text-lg font-mono font-bold text-white mb-4 flex items-center">
            <BarChart3 size={20} className="mr-2 text-green-500" />
            WEEKLY STATISTICS
          </h2>

          <div className="grid grid-cols-4 gap-4">
            <div className="text-center">
              <div className="text-2xl font-mono font-bold text-green-400">
                {Math.floor((focusStats.totalFocusTime || 0) / 60)}h {(focusStats.totalFocusTime || 0) % 60}m
              </div>
              <div className="text-xs text-gray-400">TOTAL TIME</div>
            </div>
            <div className="text-center">
              <div className="text-2xl font-mono font-bold text-blue-400">
                {focusStats.totalSessions || 0}
              </div>
              <div className="text-xs text-gray-400">SESSIONS</div>
            </div>
            <div className="text-center">
              <div className="text-2xl font-mono font-bold text-yellow-400">
                {focusStats.currentStreak || 0}
              </div>
              <div className="text-xs text-gray-400">CURRENT STREAK</div>
            </div>
            <div className="text-center">
              <div className="text-2xl font-mono font-bold text-purple-400">
                {focusStats.bestStreak || 0}
              </div>
              <div className="text-xs text-gray-400">BEST STREAK</div>
            </div>
          </div>
        </motion.div>
      )}

      {/* Category XP Breakdown */}
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.1 }}
        className="bg-gray-800 border-2 border-purple-500 p-6"
      >
        <h2 className="text-lg font-mono font-bold text-white mb-4 flex items-center">
          <Trophy size={20} className="mr-2 text-purple-500" />
          CATEGORY XP BREAKDOWN
        </h2>

        {categories.length > 0 ? (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
            {categories
              .filter(cat => cat.xp > 0) // Only show categories with XP
              .sort((a, b) => (b.xp || 0) - (a.xp || 0)) // Sort by XP descending
              .map(category => {
                const IconComponent = getIconComponent(category.iconName);
                return (
                  <div
                    key={category.id}
                    className="bg-gray-900 border border-gray-600 p-4 relative"
                    style={{
                      borderColor: category.color,
                      boxShadow: `0 0 10px ${category.color}30`
                    }}
                  >
                    <div className="flex items-center gap-3 mb-2">
                      <IconComponent 
                        size={24} 
                        style={{ color: category.color }}
                      />
                      <div>
                        <div className="font-mono font-bold text-white">
                          {category.name}
                        </div>
                        <div className="text-xs text-gray-400">
                          {category.xp || 0} minutes
                        </div>
                      </div>
                    </div>

                    {/* XP Progress Bar */}
                    <div className="w-full bg-gray-700 h-2 border border-gray-600">
                      <div 
                        className="h-full"
                        style={{ 
                          width: `${Math.min((category.xp || 0) / 100 * 100, 100)}%`,
                          backgroundColor: category.color
                        }}
                      />
                    </div>
                  </div>
                );
              })}
          </div>
        ) : (
          <div className="text-center py-8">
            <Target size={48} className="text-gray-500 mx-auto mb-3" />
            <div className="text-gray-400 font-mono">
              No focus sessions recorded yet. Start a session to see your XP!
            </div>
          </div>
        )}
      </motion.div>
    </div>
  );
};

export default TrackerTab;
